import React from 'react';
import { FilePreview, getLanguageFromFileName } from './filePreview';

describe('FilePreview', () => {
  let wrapper = null;
  const sourceFiles = {
    "1": {
      data: "SGVsbG8gV29ybGQh"
    },
    "2": {
      data: "gAN9cQBYBgAAAHJlc3VsdHEBWAwAAABIZWxsbyB3b3JsZCFxAnMu"
    },
    "3": {
      data: ""
    },
    "4": {
      data: ""
    }
  };

  beforeEach(() => {
    wrapper = shallow(
      <FilePreview fileId="1" fileName="hello_world.py" sourceFiles={sourceFiles}/>
    );
  });

  describe('should render correctly', () => {

    it('text files', () => {
      expect(wrapper).toMatchSnapshot();
    });

    it('pickle files', () => {
      wrapper = shallow(
        <FilePreview fileId="2" fileName="result.pickle" sourceFiles={sourceFiles}/>
      );

      expect(wrapper).toMatchSnapshot();
    });

    it('svg files', () => {
      wrapper = shallow(
        <FilePreview fileId="3" fileName="test.svg" sourceFiles={sourceFiles}/>
      );

      expect(wrapper).toMatchSnapshot();
    });

    it('image files', () => {
      wrapper = shallow(
        <FilePreview fileId="4" fileName="output.png" sourceFiles={sourceFiles}/>
      );

      expect(wrapper).toMatchSnapshot();
    });
  });

  it('should map language from filename correctly', () => {
    let fileName = 'abc.py';

    expect(getLanguageFromFileName(fileName)).toEqual('python');
    fileName = 'unknown.abc';

    expect(getLanguageFromFileName(fileName)).toEqual('');
  });

});
